TensorFlow Lite is a lighter version of TensorFlow, which is specifically designed for the mobile platform and embedded devices. TFLite is intended to provide the ability to perform predictions on a trained model (load the model not to train the model). On the other hand TF is used to build (train) the model.

TFLite optimises the model using quantisation techniques which is dramatically reduces both the memory requirement and computational cost of using neural networks.Please take a look at this link [1](https://www.tensorflow.org/lite/api_docs/python/tf/lite/TFLiteConverter) and [2](https://www.tensorflow.org/lite/guide/inference).It helps.Thanks!

